import{_ as e,o,c as t,Q as n}from"./chunks/framework.6e0d310a.js";const r="/teamone/img/issues/connection_error.png",a="/teamone/img/issues/ssl_error.png",i="/teamone/img/issues/property_storage_qouta_limit_error.png",w=JSON.parse('{"title":"TeamOne","titleTemplate":"Issues","description":"","frontmatter":{"title":"TeamOne","titleTemplate":"Issues"},"headers":[],"relativePath":"doc/issues.md","filePath":"doc/issues.md"}'),s={name:"doc/issues.md"},l=n('<h2 id="connection-issue" tabindex="-1">Connection issue <a class="header-anchor" href="#connection-issue" aria-label="Permalink to &quot;Connection issue&quot;">​</a></h2><p><img src="'+r+'" alt="img" data-zoomable=""></p><p>If you get <em>TeamOne is having issues connecting to IBM PA</em>, try the following steps:</p><ul><li>check your VPN connection (if you are using one)</li><li>check <a href="https://status.succeedium.com/" target="_blank" rel="noreferrer">TeamOne status</a></li><li>click the <strong>CHECK</strong> connection button below and if you see an SSL warning (i.e. &quot;Your connection is not private&quot;, &quot;Your connection is not secure&quot;, etc.), you should configure a <a href="https://www.ibm.com/support/pages/node/886183" target="_blank" rel="noreferrer">custom SSL certificate</a> for your IBM PA server. You can temporarily accept the warning by clicking the <strong>Advanced</strong> button below and then <strong>Proceed</strong> to. After that you can go back to Google Sheets and re-open the TeamOne sidebar.</li></ul><p><img src="'+a+'" alt="img" data-zoomable=""></p><ul><li>Check your IBM PA (TM1) server is up</li><li>Are you using IBM PA hosted on AWS or elsewhere? Check the firewall rules and make sure the <strong>HTTPPortNumber</strong> port is open</li><li><a href="https://succeedium.com/teamone/contact" target="_blank" rel="noreferrer">Contact us</a></li></ul><h2 id="teamone-add-on-not-working-when-signed-in-with-multiple-accounts" tabindex="-1">TeamOne add-on not working when signed in with multiple accounts <a class="header-anchor" href="#teamone-add-on-not-working-when-signed-in-with-multiple-accounts" aria-label="Permalink to &quot;TeamOne add-on not working when signed in with multiple accounts&quot;">​</a></h2><p>Additionally you may see the following messages in Dev console:</p><ul><li>Exception: You do not have permission to access the requested document.</li><li>ERROR: Authorization is required to perform that action. (the error message can be different in different languagues) There is a limitation of add-ons when using multiple accounts. It is documented here: <a href="https://developers.google.com/apps-script/guides/projects#fix_issues_with_multiple_google_accounts" target="_blank" rel="noreferrer">https://developers.google.com</a></li></ul><p>You can use one of the following workarounds:</p><ul><li>sing out from all accounts and sing it back first with the account you intend to use TeamOne add-on with</li><li>for Google Chrome, use a separate <a href="https://support.google.com/chrome/answer/2364824" target="_blank" rel="noreferrer">account profile</a></li><li>for Firefox, use a separate <a href="https://addons.mozilla.org/en-US/firefox/addon/multi-account-containers/" target="_blank" rel="noreferrer">account containers</a></li><li>use a different browser for TeamOne add-on</li><li>use a new incognito window</li></ul><p>We recommend using a separate Google Chrome profile (or Firefox ount container) with your work email.</p><h2 id="teamone-add-on-not-working-permission-denied" tabindex="-1">TeamOne add-on not working. PERMISSION_DENIED <a class="header-anchor" href="#teamone-add-on-not-working-permission-denied" aria-label="Permalink to &quot;TeamOne add-on not working. PERMISSION_DENIED&quot;">​</a></h2><p>You may also see the next error in Dev console: <em>We&#39;re sorry, a server error occurred while reading from storage. Error code PERMISSION_DENIED.?</em> This is a random error when trying to access Google script functions. Try the following to resolve it:</p><ul><li>re-open TeamOne Sidebar</li><li>re-fresh page and try opening TeamOne Sidebar</li><li>re-login to your Google account, re-open your Google sheet and try opening TeamOne Sidebar</li></ul><h2 id="teamone-add-on-not-working-in-incognito-window" tabindex="-1">TeamOne add-on not working in incognito window <a class="header-anchor" href="#teamone-add-on-not-working-in-incognito-window" aria-label="Permalink to &quot;TeamOne add-on not working in incognito window&quot;">​</a></h2><p>You may also see the next error in Dev console: <em>Error in v-on handler: &quot;SecurityError: Failed to read the &#39;localStorage&#39; property from &#39;Window&#39;: Access is denied for this document.&quot;</em> TeamOne add-on is using cookies and it may be blocked by your browser, for instance under Chrome&#39;s Settings &gt; Privacy &gt; Content settings, you have the cookie setting set to &quot;Block sites from setting any data&quot;. Enable cookies and try again.</p><h2 id="teamone-formula-returns-unknown-function-error" tabindex="-1">=TEAMONE() formula returns &quot;unknown function&quot; error <a class="header-anchor" href="#teamone-formula-returns-unknown-function-error" aria-label="Permalink to &quot;=TEAMONE() formula returns &quot;unknown function&quot; error&quot;">​</a></h2><p>Make sure you opened the TeamOne sidebar, it will load all the add-on scripts including the <em><strong>TEAMONE()</strong></em> function.</p><p>In some cases (like when you copy an existing sheet document), add-ons may require you to re-acivate them. Try the next steps:</p><ol><li>Go to <em>Extensions &gt; TeamOne &gt; Help</em> menu</li><li>Click <em>View in store</em></li><li>Click the <em>Settings</em> icon at the top right and select <em>Manage Apps</em></li><li>Click the <em>Options</em> icon (3 vertical dots) on the TeamOne add-on card</li><li>Uncheck <em>Use in this document</em></li><li>Click the <em>Options</em> icon icon again and select <em>Use in this document</em></li><li>Close the marketplace screen</li><li>Refresh the page and try <em>TEAMONE recalculate</em> on the sidebar functions tab</li></ol><h2 id="resultsetoutofmemory-auditlogmaxquerymemory-too-small" tabindex="-1">ResultSetOutOfMemory: AuditLogMaxQueryMemory too small <a class="header-anchor" href="#resultsetoutofmemory-auditlogmaxquerymemory-too-small" aria-label="Permalink to &quot;ResultSetOutOfMemory: AuditLogMaxQueryMemory too small&quot;">​</a></h2><p>If you are getting <em><strong>ResultSetOutOfMemory: AuditLogMaxQueryMemory too small</strong></em> please make sure you have PA 2.0.9.17 or later</p><h2 id="property-storage-quota" tabindex="-1">Property storage quota <a class="header-anchor" href="#property-storage-quota" aria-label="Permalink to &quot;Property storage quota&quot;">​</a></h2><p>TeamOne stores all the settings, formulas and explorations using the <a href="https://developers.google.com/apps-script/guides/properties" target="_blank" rel="noreferrer">Google Properties Service</a>. This service has certain <a href="https://developers.google.com/apps-script/guides/services/quotas#current_limitations" target="_blank" rel="noreferrer">qoutas</a>, in particular, 500 KB for storage per document and will receive the next error if exceeding this limit: &quot;Exception: You have exceeded the property storage quota. Please remove some properties and try again. (line 66).&quot;</p><p><img src="'+i+'" alt="img" data-zoomable=""></p><p>See <a href="./content-manager.html#memory-usage">Memory usage</a> to troubleshoot and resolve this issue.</p>',27),u=[l];function c(m,d,h,g,p,f){return o(),t("div",null,u)}const k=e(s,[["render",c]]);export{w as __pageData,k as default};
